//import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
//import { faLinkedin, faGithub } from "@fortawesome/free-brands-svg-icons";
import Navbar from "./Navbar";
import Footer from "./Footer";
import '../Environnement.css'

const Environnement = () => {
    return (
        <div className="environnement">
            <Navbar />
            <h4>Voici mon environnement d'éxécution: </h4>
            <h5>Debian 11 Bullseye</h5>
            <div id="debian_link">
                <h5>Pourquoi j'ai choisi Debian 11 Bullseye? (Et pas Windows 11 : &#128540; )</h5>
                <img src="./img/debian-1.png" alt="Debian logo"></img>
            </div>

            <Footer />
        </div>
    );
};

export default Environnement;
